import "./TripStyles.css";
import TripData from "../components/TripData";
import Trip1 from "../assects/img1.jpg";
import Trip2 from "../assects/img2.jpg";
import Trip3 from "../assects/img3.jpg";

function Trip(){
    return(
        <div className="trip">
            <h1>Recent Trips</h1>
            <p>The concat Javascript multiline comments, also known as block comments,
                 start with a forward slash followed by an asterisk method joins two 
                 or more strings. The concat method does not change the existing strings.
                  The concat method returns a new string.</p>
            <div className="tripcard">
                <TripData
                    image={Trip1}
                    heading= "Australia"
                    text= "Australia, officially the Commonwealth of Australia, is a sovereign country comprising the mainland of the Australian continent, the island of Tasmania, and numerous smaller islands. Australia is the largest country by area in Oceania and the world's sixth-largest country."
                />

                <TripData
                    image={Trip2}
                    heading= "Malaysia"
                    text= "Malaysia is a Southeast Asian country occupying parts of the Malay Peninsula and the island of Borneo. It's known for its beaches, rainforests and mix of Malay, Chinese, Indian and European cultural influences. The capital, Kuala Lumpur, is home to colonial buildings, busy shopping districts such as Bukit Bintang and skyscrapers such as the iconic, 451m-tall Petronas Twin Towers."
                />

                <TripData
                    image={Trip3}
                    heading= "Singappore"
                    text= "Singapore was called Singapura, which translates as Lion City in Sanskrit, by a Sumatran Prince after he thought he saw a lion on the island (it was probably a tiger). Singapore has the World's busiest port. Singapore is a city, a capital and a state all at once, making it one of only three City States in the world."
                />
                
            </div>
        </div>
    );
}

export default Trip;
